"use strict";(self.webpackChunkjohnycho_dev=self.webpackChunkjohnycho_dev||[]).push([[8130],{7735:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"spring-cloud-config-decrypt","metadata":{"permalink":"/blog/spring-cloud-config-decrypt","source":"@site/blog/2025-11-06-spring-cloud-config-decrypt.mdx","title":"Spring Cloud Config\uc758 \ubcf5\ud638\ud654 \uc2e4\ud328 \ucc98\ub9ac \uacfc\uc815 \u2014 {cipher}...\uac00 invalid.*\ub85c \ubc14\ub00c\ub294 \uc774\uc720","description":"Spring Cloud Config Server\ub97c \uc4f0\ub2e4 \ubcf4\uba74,","date":"2025-11-06T00:00:00.000Z","tags":[{"inline":false,"label":"Spring","permalink":"/blog/tags/spring","description":"Spring tag description"}],"readingTime":3.005,"hasTruncateMarker":false,"authors":[{"name":"Johny Cho","title":"Back End Engineer @ NHN","url":"https://github.com/johnycho","page":{"permalink":"/blog/authors/johnycho"},"socials":{"github":"https://github.com/johnycho","instagram":"https://www.instagram.com/johny__cho","linkedin":"https://www.linkedin.com/in/johny-cho/"},"imageURL":"https://github.com/johnycho.png","key":"johnycho"}],"frontMatter":{"slug":"spring-cloud-config-decrypt","title":"Spring Cloud Config\uc758 \ubcf5\ud638\ud654 \uc2e4\ud328 \ucc98\ub9ac \uacfc\uc815 \u2014 {cipher}...\uac00 invalid.*\ub85c \ubc14\ub00c\ub294 \uc774\uc720","authors":["johnycho"],"tags":["spring"]},"unlisted":false,"nextItem":{"title":"\ud83c\udf89 \uac1c\ubc1c \ube14\ub85c\uadf8 \uc624\ud508 \ud83c\udf89","permalink":"/blog/johny-dev-blog-launched"}},"content":"Spring Cloud Config Server\ub97c \uc4f0\ub2e4 \ubcf4\uba74,\\n\uc554\ud638\ud654\ub41c \uc124\uc815\uac12 `{cipher}...`\uac00 \ubcf5\ud638\ud654\uc5d0 \uc2e4\ud328\ud558\uba74\uc11c `invalid.my.secret` \ud615\ud0dc\ub85c \ub178\ucd9c\ub418\uace0,\\n\uacb0\uad6d \ub85c\uceec `application.properties`\uc758 \uac12\uc774 \uc801\uc6a9\ub418\ub294 \uac78 \ubcf8 \uc801\uc774 \uc788\uc744 \uac81\ub2c8\ub2e4.\\n\\n\uc624\ub298\uc740 \uadf8 \ub0b4\ubd80 \uba54\ucee4\ub2c8\uc998\uc744 \ucf54\uc5b4 \ucf54\ub4dc \ub808\ubca8\uc5d0\uc11c\uae4c\uc9c0 \ub72f\uc5b4\ubcf4\ub824 \ud569\ub2c8\ub2e4.\\n\\n## \uc554\ud638\ud654\ub41c \uc124\uc815\uc774 \uc11c\ubc84\uc5d0 \uc804\ub2ec\ub418\ub294 \uad6c\uc870\\nConfig Server\ub294 Git, FileSystem, Vault \ub4f1\uc5d0\uc11c \uc124\uc815 \ud30c\uc77c\uc744 \uc77d\uace0,\\n`EnvironmentRepository.findOne()`\uc744 \ud1b5\ud574 \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0 `Environment` \uac1d\uccb4(JSON)\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\n\\n\uc774\ub54c \uc124\uc815\uac12 \uc911 `{cipher}...`\ub85c \uc2dc\uc791\ud558\ub294 \ud56d\ubaa9\uc774 \uc788\uc73c\uba74  \\n`EnvironmentController` \u2192 `EnvironmentRepository` \u2192 `EnvironmentEncryptor.decrypt()`\\n\ub2e8\uacc4\ub97c \uac70\uce58\uba70 \ubcf5\ud638\ud654\ub97c \uc2dc\ub3c4\ud569\ub2c8\ub2e4.\\n```java\\n// EnvironmentEncryptorEnvironmentRepository.java\\n@Override\\npublic Environment findOne(String name, String profiles, String label, boolean includeOrigin) {\\n    Environment environment = this.delegate.findOne(name, profiles, label, includeOrigin);\\n    if (this.environmentEncryptors != null) {\\n        for (EnvironmentEncryptor environmentEncryptor : environmentEncryptors) {\\n            environment = environmentEncryptor.decrypt(environment);\\n        }\\n    }\\n    if (!this.overrides.isEmpty()) {\\n        environment.addFirst(new PropertySource(\\"overrides\\", getOverridesMap(includeOrigin)));\\n    }\\n    return environment;\\n}\\n```\\n\uae30\ubcf8\uc801\uc73c\ub85c \uc544\ub798 \ub450 \uac1c\uc758 `EnvironmentEncryptor`\uac00 \uc874\uc7ac\ud569\ub2c8\ub2e4.\\n* `CipherEnvironmentEncryptor` (\uae30\ubcf8 RSA/Key \uae30\ubc18 \ubcf5\ud638\ud654)\\n* `VaultEnvironmentEncryptor` (HashiCorp Vault \uc5f0\ub3d9 \uc2dc)\\n\\n## \ubcf5\ud638\ud654 \uc2e4\ud328 \uc2dc `invalid.*` \ud0a4\ub85c \ubb34\ud6a8\ud654 \ucc98\ub9ac\\n`CipherEnvironmentEncryptor.decrypt()` \ub0b4\ubd80\ub97c \ubcf4\uba74,\\n\uac01 `PropertySource`\uc758 \ud0a4/\uac12\uc744 \uc21c\ud68c\ud558\uba70 `{cipher}` \uc811\ub450\uc5b4\uac00 \ubd99\uc740 \ud56d\ubaa9\uc744 \ubcf5\ud638\ud654\ud569\ub2c8\ub2e4.\\n\\n\ubcf5\ud638\ud654 \uc911 \uc608\uc678(`EncryptionOperationNotPossibleException`)\uac00 \ubc1c\uc0dd\ud558\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 \ucc98\ub9ac\ub429\ub2c8\ub2e4.\\n```java\\n// CipherEnvironmentEncryptor.decrypt() \ucf54\ub4dc \uc694\uc57d\\ncatch (Exception e){\\n    if(this.prefixInvalidProperties) {\\n        value = \\"<n/a>\\";\\n        name = \\"invalid.\\" + name;\\n    }\\n    String message = \\"Cannot decrypt key: \\" + key + \\" (\\" + e.getClass() + \\": \\" + e.getMessage() + \\")\\";\\n}\\nmap.put(name, value);\\n```\\n\uc989, \uc6d0\ub798 \ud0a4 `my.secret` \ub300\uc2e0 `invalid.my.secret`\uc774 \ucd94\uac00\ub429\ub2c8\ub2e4.  \\n\uc774\ub54c \uae30\uc874 `my.secret` \ud0a4\ub294 \uc874\uc7ac\ud558\uc9c0 \uc54a\uc73c\ubbc0\ub85c, Config Client\ub294 \uc774 \uac12\uc744 \ubb34\uc2dc\ud558\uac8c \ub429\ub2c8\ub2e4.\\n\\n## \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0\uc11c `invalid.*` \uac00 \ubb34\uc2dc\ub418\ub294 \uc774\uc720\\nConfig Client\uac00 \uc11c\ubc84\ub85c\ubd80\ud130 \ubc1b\uc740 \uc124\uc815\uc744 `Environment`\ub85c \uba38\uc9c0\ud560 \ub54c,\\n`PropertySourcesPropertyResolver`\uac00 \uc21c\uc11c\ub300\ub85c `PropertySource`\ub97c \uc21c\ud68c\ud558\uba70 \uac12\uc744 \ucc3e\uc2b5\ub2c8\ub2e4.\\n1.\\t\uba3c\uc800 `configserver:*` `PropertySource`\ub97c \ud0d0\uc0c9\\n2.\\t`{cipher}` \ubcf5\ud638\ud654 \uc2e4\ud328 \u2192 `invalid.my.secret`\ub9cc \uc874\uc7ac\\n3.\\t\ucc3e\uc9c0 \ubabb\ud558\uba74 \ub2e4\uc74c `PropertySource` (\ub85c\uceec \ud30c\uc77c \ub4f1)\ub85c fall-through\\n4.\\t`application.properties`\uc5d0\uc11c `my.secret=localValue` \ubc1c\uacac \u2192 \ubc18\ud658 \u2705\\n\\n\uc989, `invalid.*` \ud0a4\ub294 <mark>**\ub2e8\uc9c0 \uc2e4\ud328 \ud754\uc801\uc77c \ubfd0**</mark>, `Environment`\uc5d0\uc11c\ub294 <mark>**\ucc38\uc870\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.**</mark>\\n\\n\uc774 \ub3d9\uc791\uc740 `AbstractEnvironment` \ub0b4\ubd80\uc5d0\uc11c merge\ub420 \ub54c, \ub2e8\uc21c\ud788 `PropertySource` \uc21c\uc11c\ub300\ub85c \ubd99\uae30 \ub54c\ubb38\uc5d0\\n\ud2b9\ubcc4\ud55c \uc608\uc678\ucc98\ub9ac \uc5c6\uc774 <mark>\u201c\ub4a4\uc5d0 \uc624\ub294 `PropertySource`\uac00 \uc6b0\uc120\uad8c\uc744 \uac00\uc9c4\ub2e4\u201d</mark>\ub294 \uc77c\ubc18 \uaddc\uce59\uc73c\ub85c \ud574\uacb0\ub429\ub2c8\ub2e4."},{"id":"johny-dev-blog-launched","metadata":{"permalink":"/blog/johny-dev-blog-launched","source":"@site/blog/2025-02-03-johny-dev-blog-launched.mdx","title":"\ud83c\udf89 \uac1c\ubc1c \ube14\ub85c\uadf8 \uc624\ud508 \ud83c\udf89","description":"_","date":"2025-02-03T00:00:00.000Z","tags":[{"inline":false,"label":"Hello","permalink":"/blog/tags/hello","description":"Hello tag description"}],"readingTime":2.82,"hasTruncateMarker":true,"authors":[{"name":"Johny Cho","title":"Back End Engineer @ NHN","url":"https://github.com/johnycho","page":{"permalink":"/blog/authors/johnycho"},"socials":{"github":"https://github.com/johnycho","instagram":"https://www.instagram.com/johny__cho","linkedin":"https://www.linkedin.com/in/johny-cho/"},"imageURL":"https://github.com/johnycho.png","key":"johnycho"}],"frontMatter":{"slug":"johny-dev-blog-launched","title":"\ud83c\udf89 \uac1c\ubc1c \ube14\ub85c\uadf8 \uc624\ud508 \ud83c\udf89","authors":["johnycho"],"tags":["hello"]},"unlisted":false,"prevItem":{"title":"Spring Cloud Config\uc758 \ubcf5\ud638\ud654 \uc2e4\ud328 \ucc98\ub9ac \uacfc\uc815 \u2014 {cipher}...\uac00 invalid.*\ub85c \ubc14\ub00c\ub294 \uc774\uc720","permalink":"/blog/spring-cloud-config-decrypt"}},"content":"import BrowserOnly from \'@docusaurus/BrowserOnly\';\\n\\n___\\n\\n# \ud14c\uc2a4\ud2b8 \ub9c8\ud06c \ub2e4\uc6b4 \ubb38\uc11c\ub97c \uc791\uc131\ud574\ubd05\ub2c8\ub2e4..\\n\\n\x3c!-- truncate --\x3e\\n\\n## :heavy_check_mark:\ufe0f Glorious Demo with TypeScript\\n---\\n\uc544\ub798\ub294 `glorious-demo`\ub97c \uc774\uc6a9\ud55c \uc5d0\ub514\ud130 + \ud130\ubbf8\ub110 \uc560\ub2c8\uba54\uc774\uc158 \uc608\uc81c\uc785\ub2c8\ub2e4.\\n\\n<BrowserOnly fallback={<p>Loading terminal...</p>}>\\n{() => {\\nconst GloriousTerminal = require(\'@site/src/components/GloriousTerminal\').default;\\nreturn (\\n<GloriousTerminal\\ncode={`\\nfunction greet(){\\nconsole.log(\\"Hello World!\\");\\n}\\n\\ngreet();\\n`}\\ncommand=\\"node ./demo\\"\\nresponse=\\"Hello World!\\"\\n/>\\n);\\n}}\\n</BrowserOnly>\\n\\n<br /><br /><br /><br /><br /><br />\\n\\n## :heavy_check_mark: Javascript \ucf54\ub4dc \ube14\ub7ed\\n---\\n\\n```js\\n<button onClick={() => alert(\'button clicked!\')}>Click me!</button>\\n```\\n\\n## :heavy_check_mark: Java \ucf54\ub4dc \ube14\ub7ed\\n---\\n\\n```java\\npackage com.nhn.meta.banword.application;\\n\\nimport java.util.Arrays;\\nimport java.util.Collections;\\nimport java.util.Map;\\nimport java.util.stream.Collectors;\\n\\npublic class Solution {\\n\\n  public static void main(String[] args) {\\n// \ud14c\uc2a4\ud2b8 \ucf00\uc774\uc2a4 \uc2e4\ud589 \ubc0f \uacb0\uacfc \ucd9c\ub825\\n    System.out.println(\\"Test Case 1 Result: \\" + solution(2, \\"1A 2F 1C\\") + \\" (Expected: 2)\\");\\n    System.out.println(\\"Test Case 2 Result: \\" + solution(3, \\"\\") + \\" (Expected: 6)\\");\\n    System.out.println(\\n        \\"Test Case 3 Result: \\" + solution(1, \\"1A 1B 1C 1D 1E 1F 1G 1H 1J 1K\\") + \\" (Expected: 0)\\");\\n    System.out.println(\\n        \\"Test Case 4 Result: \\" + solution(50, \\"1A 3C 2B 20G 5A 7K 40D 50H\\") + \\" (Expected: 95)\\");\\n    System.out.println(\\n        \\"Test Case 5 Result: \\" + solution(2, \\"1A 1C 1D 1F 1G 1J 2C 2H\\") + \\" (Expected: 1)\\");\\n    System.out.println(\\n        \\"Test Case 6 Result: \\" + solution(22, \\"1A 3C 2B 20G 5A\\") + \\" (Expected: 41)\\");\\n  }\\n\\n  public static int solution(int N, String S) {\\n    final Map<String, Boolean> reserved = splitStringToMap(S);\\n\\n    int maxFamilies = 0;\\n\\n    for (int row = 1; row <= N; row++) {\\n      boolean leftAndCenter =\\n          !reserved.containsKey(row + \\"B\\") &&\\n              !reserved.containsKey(row + \\"C\\") &&\\n              !reserved.containsKey(row + \\"D\\") &&\\n              !reserved.containsKey(row + \\"E\\");\\n\\n      boolean centerOnly =\\n          !reserved.containsKey(row + \\"D\\") &&\\n              !reserved.containsKey(row + \\"E\\") &&\\n              !reserved.containsKey(row + \\"F\\") &&\\n              !reserved.containsKey(row + \\"G\\");\\n\\n      boolean centerAndRight =\\n          !reserved.containsKey(row + \\"F\\") &&\\n              !reserved.containsKey(row + \\"G\\") &&\\n              !reserved.containsKey(row + \\"H\\") &&\\n              !reserved.containsKey(row + \\"J\\");\\n\\n      int familiesAdded = 0; // \ub514\ubc84\uae45\uc6a9 \ucd94\uac00\\n      if (leftAndCenter) {\\n        maxFamilies++;\\n        familiesAdded++;\\n      }\\n\\n      if (centerAndRight) {\\n        maxFamilies++;\\n        familiesAdded++;\\n      }\\n\\n      if (!leftAndCenter && !centerAndRight && centerOnly) {\\n        maxFamilies++;\\n        familiesAdded++;\\n      }\\n\\n      // \ud589\ubcc4\ub85c \ucd94\uac00\ub41c \uac00\uc871 \uc218 \ucd9c\ub825\\n      System.out.printf(\\n          \\"Row %d: leftAndCenter=%b, centerOnly=%b, centerAndRight=%b, Families added=%d\\\\n\\",\\n          row, leftAndCenter, centerOnly, centerAndRight, familiesAdded);\\n    }\\n\\n    return maxFamilies;\\n  }\\n\\n  public static Map<String, Boolean> splitStringToMap(String s) {\\n    if (s == null || s.trim().isEmpty()) {\\n      return Collections.emptyMap(); // \ubb38\uc790\uc5f4\uc774 \ube44\uc5b4\uc788\uc73c\uba74 \ube48 \ub9f5 \ubc18\ud658\\n    }\\n\\n    // \uacf5\ubc31 \uae30\uc900\uc73c\ub85c \ub098\ub208 \ud6c4, \uac01 \ub2e8\uc5b4\ub97c \ud0a4\ub85c, \ub2e8\uc5b4\uc758 \uae38\uc774\ub97c \uac12\uc73c\ub85c \ub9f5\uc5d0 \uc800\uc7a5\\n    return Arrays.stream(s.split(\\"\\\\\\\\s+\\")) // \uacf5\ubc31 \uae30\uc900\uc73c\ub85c \ubb38\uc790\uc5f4 \ubd84\ub9ac\\n        .filter(word -> !word.isEmpty()) // \ube44\uc5b4 \uc788\ub294 \ubb38\uc790\uc5f4 \uc81c\uac70\\n        .collect(Collectors.toMap(word -> word, word -> true));\\n  }\\n}\\n```\\n\\n## :heavy_check_mark: Task List\\n---\\n\\n- [x] Write the press release\\n- [ ] Update the website\\n- [ ] Contact the media\\n\\n## :heavy_check_mark: Using Emoji Shortcodes\\n---\\nGone camping! :tent: Be back soon.\\n\\nThat is so funny! :joy:\\n\\n## :heavy_check_mark: Highlight\\n---\\nI need to highlight these <mark>very important words</mark>.\\n\\n## :heavy_check_mark: Table\\n---\\n\\n| Syntax    | Description |\\n|-----------|-------------|\\n| Header    | Title       |\\n| Paragraph | Text        |"}]}}')}}]);